INSERT INTO `products` (`Id`, `Name`, `Description`, `Details`, `Features`, `Specification`, `Image`) VALUES
('DCP20206308', 'Senior Citizen Card', 'There are multiple benefits for people interested in getting senior citizens cards. These benefits include convenience, monetary, assistance in many w', 'Some of these benefits include:\r\nA 30% Railway concession for people of 60 years or more\r\nA 50% Karnataka Transport discount for people who are 65 years', 'Air travel concession of 50% on the basic fare for people who are 65 years or more.\r\nA 30% discount at multiple private hospitals for  age of 60 years', 'Government hospitals provide free treatment for 60 years old or older.\r\nBanks provide an additional interest of 0.5% to 60-year-olds.', 'storage/app/Product_Images/cL0o17ltx9hyAfF3DSlzMLDqjurJXjfKMZp6LNez.png'),
('DCP20209532', 'New Pan Card', 'PAN, or permanent account number, is a unique 10-digit alphanumeric identity allotted to each taxpayer by the Income Tax Department.', 'Anybody who earns a taxable income in India, including foreign nationals who pay taxes here\r\nAnybody who runs a business.', 'WHY GET A PAN NUMBER?\r\nFor payment of direct taxes\r\nTo file income tax returns\r\nTo avoid deduction of tax at higher rate than due', 'To enter into specific transaction such as:\r\n(a) Sale or purchase of immovable property valued at Rs 5 lakh or more\r\n(b) Sale or purchase of a vehicle', 'storage/app/Product_Images/lDyAs4ix3ATxgXhiyTqZ06TFR7gLEI9y9ftzvOml.jpg'),
('DCP20205102', 'Pan Card Correction', 'is any Changes need to be done in your Pan Card?? Now Simplify your work with Digitally we help you to correct your Pan Card Easily.', 'Any Correction like, Name, DOB, Father Name, Signature or Photo you can update Now', 'Updated Aadhar Card with Previous Pan Card is more than Enough to Update your Pan Card', 'Get your Pan in 30 Working Days. ', 'product_images/pan-card-services-250x250.png'),
('DCP20205054', 'Caste Certificate', 'Caste Certificate that help you to get your reservation in government scholarships and help to study higher with your Caste', 'Know your Caste and get your Caste certificate to avail the various government reservations under state and central government schemes.', 'We at Digital Cyber Pvt Ltd, help common people to get these certificates with hassle free services and with in limited period of time', 'Genera & Tatkal Services Available to get your Certificate,', 'storage/app/Product_Images/BDnUUiADXVwbYlLhBg2NwZOMIBxTsbWiRt0Dt7Qg.png'),
('DCP20208193', 'Income Certificate', 'Income Certificate help you to declare your Annual Income from all the source to know the government eligible scheme in which you come under.', 'Application for Income Certificate made easy with Digital cyber ', 'AAdhar Card and BPL Ration is Required to obtain Income Certificate under weaker Section.', '', 'product_images/CV.png'),
('DCP21218728', 'SBI CSP', 'State Bank of India! One of the Top Most Bank in the Indian Banking Sector. \r\nWe @ Digital cyber Pvt Ltd is Registered Customer Service Point', 'Digital Cyber Pvt. Ltd. Provides All State Bank of India Financial Services Like \r\n1. Account Opening\r\n2. Cash Deposit\r\n3. Cash Withdrawal', '4. Money Transfer\r\n5. Recurring Deposit\r\n6. Fixed Deposit\r\n7. Social Security Scheme Enrollment\r\n8.Zero Balance Account \r\n9.Aadhar Seeding', '10. Mobile Number Seeding\r\n11. Balance Enquiry \r\n\r\nMany More Services are Available', 'storage/app/Product_Images/qQPK69MIEngFo4cTSHTS6Y7dPq3nl1uO9XnazVdf.png'),
('DCP21215369', 'Voter ID Card', 'Voter ID, also known as EPIC (Electors Photo Identity Card) is a photo identity card issued by the Election Commission of India.', 'The purpose of voter ID is to serve as identity proof for voters, increase efficiency and prevent impersonation and fraud during free Democracy', 'A unique Serial number\r\nPhotograph of the cardholder\r\nA hologram containing the respective state/national symbol\r\nName of cardholder\r\nfatherâ€™s Name', 'Gender\r\nCard holderâ€™s\r\nCard holderâ€™s date of Birth\r\nThe card holderâ€™s residential address and signature of the issuing authority', 'storage/app/Product_Images/zUgMT2AKPKxKh7l3JtcR4PR5QKYV8VZjMd8hcOfF.png'),
('DCP21214969', 'Indian Passport', 'An Indian passport is issued by the Indian Ministry of External Affairs to Indian citizens for the purpose of international travel.', 'It enables the bearer to travel internationally and serves as proof of Indian citizenship as per the Passports Act (1967).', 'In 2015, India issued about 12 million passports, a number exceeded only by China and the United States.', 'Document Required are \r\n1. Aadhar Card\r\n2. Pan Card\r\n3. SSLC Marks Card', 'storage/app/Product_Images/MfYLbh31qeitPxkHgs7ya6GM5J93Er5587vQKF8g.jpg'),
('DCP21218017', 'Two Wheeler Insuranc', 'Vehicle insurance also known as car insurance, motor insurance, or auto insurance)is insurance for cars, trucks, motorcycles, and other road vehicles.', 'In many jurisdictions, it is compulsory to have vehicle insurance before using or keeping a motor vehicle on public roads.', 'Documents Required to Renew Bike Insurance are', '1. RC Card\r\n2. Aadhar Card\r\n3. Previous Insurance Copy', 'storage/app/Product_Images/58NKVwTpbxHM4IZcXzsBaP6Ytx9p8xLR8Hu5Jyhk.jpg'),
('DCP21212776', 'Car Insurance', 'Motor vehicle insurance law in India is governed by the Motor Vehicles Act, Insurance Act and aspects of insurance contracts governed by the Indian', 'In many jurisdictions, it is compulsory to have vehicle insurance before using or keeping a motor vehicle on public roads.', 'Documents Required to renew Car Insurance Policy are', '1. RC Card\r\nPrevious Insurance Copy', 'storage/app/Product_Images/ibFNnp0E8AtejuBFNDU0yuHMbJsRxyxcwzffBHRI.jpg'),
('DCP21213260', 'Aadhar Update', 'Aadhar is a Unique Identity of Indian Resident, Every individual must have their Unique Identity Number called as Aadhaar Number of 12 Digits', 'One Must Keep their Aadhar Update Every Day to Avoid unnecessary time waste at any work required at that point of Time', 'We at Digital Cyber Assit. People of India to Update their Aadhaar Card through Online Portal using Predefined Terms and Conditions from UIDAI.', 'Aadhar Updates as Follows:\r\n1. Name \r\n2. Father Name \r\n3. Address\r\n4.Gender\r\n5. DOB\r\n\r\nUsing Valid Proof ..', 'storage/app/Product_Images/aSTDUbKSYSgsr3getVfTK4YMV02R5iV7BoxuMR6K.png'),
('DCP2021385', 'Life Insurance', 'Life Insurance is an arrangement between the Insurance company/Government which guarantees of compensation for loss of life in return for payment of a specified premium.', '1. Risk Coverage: Insurance provides risk coverage to the insured family in form of monetary compensation in lieu of premium paid. \r\n 2. Difference plans for different uses: Insurance companies offer a different type of plan to the insured depending on his need for insurance. More benefits come with the more premium.\r\n3. Cover for Health Expenses: These policies also cover hospitalization expenses and critical illness treatment.', '1. Term insurance plan As the name says Term insurance plan are those plan that is purchased for a fixed period of time, say 10, 20 or 30 years. As these policies don’t carry any cash value their policies do not carry any maturity benefits, hence their policies are cheaper as compared to other policies. This policy turns beneficial only on the occurrence of the event. \r\n2. Endowment policy The only difference between the term insurance plan and the endowment policy is that endowment policy comes with the extra benefit that the policyholder will receive a lump sum amount in case if he survives until the date of maturity. Rest details of term policy are same and also applicable to an endowment policy.', '3. Money Back Policy This policy is similar to endowment policy, the only difference is that this policy provides many survival benefits which are allotted proportionately over the period of the policy term.', 'storage/app/Product_Images/756SLe7UCg9i8sqjI5iyggTR5x5v8EqD6MX37RRz.jpg');
